import { Col, Container, Form, Row } from "reactstrap";

const register = () => {
  return (
    <Container>
      <Row>
        <Col>
        <div className="paper">
          <div>
            <h2>ユーザー登録</h2>
          </div>
        </div>
        <section className="wrapper">
          <Form>
            <fieldset>

            </fieldset>
          </Form>
        </section>
        </Col>
      </Row>
    </Container>
  );
}

export default register;
